import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import classes from './App.module.css';
import './App.css';

import image1 from './1.jpg';
import image2 from './2.jpg';
import image3 from './3.jpg';
import image4 from './4.jpg';
import image5 from './5.jpg';
import image6 from './6.jpg';
import icon from './menu.png';
import search from './search.png';
import logo from './logo.png';
import backgroundVideo from './3D House Animation_1.mp4';
import p1 from './P3.jpg';
import p2 from './p4.jpeg';
import b4 from './b5.jpg';
import b5 from './b6.jpeg';

import Home from './Home';  // assuming you have a Home component for main content
import About from './About';  // assuming you have an About component
import Contact from './Contact';  // assuming you have a Contact component

function App() {
  const images = [image1, image2, image3, image4, image5, image6];
  const [currentImageIndex, setCurrentImageIndex] = useState(0);
  const [isHeaderVisible, setIsHeaderVisible] = useState(true);
  const [isSubscribed, setIsSubscribed] = useState(false);
  const [email, setEmail] = useState('');
  const [error, setError] = useState('');

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentImageIndex((prevIndex) => (prevIndex + 1) % images.length);
    }, 5000);
    return () => clearInterval(interval);
  }, [images.length]);

  useEffect(() => {
    window.addEventListener('scroll', handleScroll);
    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  const handleScroll = () => {
    setIsHeaderVisible(window.scrollY <= window.innerHeight);
  };

  const handleSubscribe = () => {
    if (email) {
      setIsSubscribed(true);
      setError('');
    } else {
      setError('Please add Email');
    }
  };

  return (
    <Router>
      <div className={classes.container}>
        <header className={classes.header} style={{ transform: isHeaderVisible ? 'translateY(0)' : 'translateY(-100%)' }}>
          <div className={classes.logoContainer}>
            <Link to="/"><img src={logo} alt="Logo" className={classes.logo} /></Link>
          </div>
          <div className={classes.iconsContainer}>
            <button className={classes.searchButton}>
              <img src={search} alt="Search Icon" className={classes.searchIcon} />
            </button>
            <Link to="/menu">
              <button className={classes.menuButton}>
                <img src={icon} alt="Menu Icon" className={classes.menuIcon} />
              </button>
            </Link>
          </div>
        </header>

        <Route path="/" exact component={Home} />
        <Route path="/about" component={About} />
        <Route path="/contact" component={Contact} />

        <div className={classes.footer}>
          <div className={classes.footerTop}>
            <div className={classes.footerIcons}>
              {/* Add your social media icons and newsletter subscription here */}
            </div>
            <div className={classes.newsletter}>
              {!isSubscribed ? (
                <div className={classes.emailSubscription}>
                  <span className={classes.emailLabel}>NEWS LETTER:</span>
                  <input
                    type="email"
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                    placeholder="EMAIL"
                    className={classes.emailInput}
                  />
                  <button className={classes.subscribeButton} onClick={handleSubscribe}>
                    <img src="path/to/subscribe/icon" alt="Subscribe" />
                  </button>
                  {error && <span className={classes.errorMessage}>{error}</span>}
                </div>
              ) : (
                <span className={classes.thankYouMessage}>Thank You for Subscribing!</span>
              )}
            </div>
          </div>
          <div className={classes.footerSections}>
            {/* Footer sections here */}
          </div>
          <div className={classes.footerBottom}>
            Â© 2024 - NN Engineers. All rights reserved.
          </div>
        </div>
      </div>
    </Router>
  );
}

export default App;
